import Hero from "../components/Hero";
import Content from "../components/Content";

import { useAuth0 } from "@auth0/auth0-react";

const {
  user,
  isAuthenticated,
  loginWithRedirect,
  logout,
} = useAuth0();

const Home = () => (
  <Fragment>
    {isAuthenticated && <Hero />}


    <hr />
    <Content />
  </Fragment>
);

export default Home;
